    def find_unknown_values(friends: List[int]) -> List[int]:
        unknown_values = [i for i, friend in enumerate(friends) if friend == 0]
        return unknown_values

    def find_friends(friends: List[int], i: int) -> List[int]:
        return [friend for friend in range(len(friends)) if friends[i] == friend and i != friend]

    def fill_unknown_values(friends: List[int], unknown_values: List[int]) -> None:
        for i in unknown_values:
            friends[i] = 1 + len(find_friends(friends, i))

    def has_cycle(friends: List[int]) -> bool:
        visited = [False] * len(friends)
        def dfs(friend: int) -> bool:
            visited[friend] = True
            for f in find_friends(friends, friend):
                if visited[f]:
                    return True
                if dfs(f):
                    return True
            return False
        return any(dfs(friend) for friend in range(len(friends)) if not visited[friend])

    def find_solution(friends: List[int]) -> List[int]:
        unknown_values = find_unknown_values(friends)
        while len(unknown_values) > 0:
            fill_unknown_values(friends, unknown_values)
            unknown_values = find_unknown_values(friends)
        if has_cycle(friends):
            return []
        return friends

    def process_input(stdin: str) -> str:
        lines = stdin.splitlines()
        n = int(lines[0])
        friends = [int(friend) for friend in lines[1].split()]
        solution = find_solution(friends)
        if not solution:
            return "IMPOSSIBLE"
        return " ".join(str(nf) for nf in solution)

    return process_input(stdin)

