                    return False
        return True

    def construct_square(tiles: dict, m: int) -> list:
        if len(tiles) != m:
            return []

        def find_next_tile(tile_type, tiles, m):
            for t in tiles[tile_type]:
                if sum(t) <= m:
                    return t
            return None

        def find_square(tiles, m):
            if not tiles:
                return []

            max_square = []
            for i in range(m):
                row = [0] * m
                max_square.append(row)

            for i in range(m):
                for j in range(i, m):
