                        tile = find_next_tile(tile_type, tiles, m)
                        if tile is None:
                            continue

                        max_square[i][j] = max(max_square[i][j], sum(tile))
                        if i != j:
                            max_square[j][i] = max(max_square[j][i], sum(tile))

                        if max_square[i][j] == m:
                            return max_square

            return []

        square = find_square(tiles, m)
        if not square or not is_symmetric(square):
            return []

        return square

