    segments = []
    for _ in range(m):
        l, r = map(int, stdin.readline().split())
        segments.append((l, r))

    def reduce_segment(segment: tuple) -> tuple:
        l, r = segment
        return (l, r - 1)

    def max_min_diff(a: list, segments: list) -> int:
        for segment in segments:
            a[segment[0]-1:segment[1]] = [x - 1 for x in a[segment[0]-1:segment[1]]]
        return max(a) - min(a)

    max_diff = 0
    chosen_segments = []
    for i in range(2**m):
        current_segments = [reduce_segment(segments[j]) if (i & (1 << j)) else segments[j] for j in range(m)]
        current_diff = max_min_diff(a, current_segments)
        if current_diff > max_diff:
            max_diff = current_diff
            chosen_segments = [j + 1 for j in range(m) if (i & (1 << j))]

    return str(max_diff) + "\n" + str(len(chosen_segments)) + "\n" + " ".join(map(str, chosen_segments)) + "\n"

