        visited.add(start)
        for a, b in roads:
            if a == start:
                if b not in visited:
                    visited |= dfs(b, visited)
            elif b == start:
                if a not in visited:
                    visited |= dfs(a, visited)
        return visited

    def count_distances(visited: set) -> int:
        distances = [0] * (n + 1)
