def solution(stdin: str) -> str:
    n, m = map(int, stdin.split()[:2])
    edges = []
    for line in stdin.split('\n')[1:]:
        if line:
            u, v, w = map(int, line.split())
            edges.append((u-1, v-1, w))

    def find(parent, u):
        if parent[u] != u:
            parent[u] = find(parent, parent[u])
        return parent[u]

    def union(parent, rank, u, v):
        u, v = find(parent, u), find(parent, v)
        if rank[u] < rank[v]:
            parent[u] = v
        elif rank[u] > rank[v]:
            parent[v] = u
        else:
            parent[v] = u
            rank[u] += 1

    def kruskal(edges):
        edges.sort(key=lambda x: x[2])
        parent = [i for i in range(n)]
        rank = [0] * n
        mst = []
        cost = 0
        for u, v, w in edges:
            if find(parent, u) != find(parent, v):
                union(parent, rank, u, v)
                mst.append((u, v, w))
                cost += w
        return mst, cost

    mst, k = kruskal(edges)
    min_ops = float('inf')

    def increase_edge(u, v, edges):
        for i in range(len(edges)):
            if edges[i][0] == u and edges[i][1] == v or edges[i][0] == v and edges[i][1] == u:
                edges[i] = (edges[i][0], edges[i][1], edges[i][2] + 1)
                return edges

    for i in range(len(mst)):
        new_edges = edges.copy()
        new_edges = increase_edge(mst[i][0], mst[i][1], new_edges)
        new_mst, new_cost = kruskal(new_edges)
        if new_cost == k:
            min_ops = min(min_ops, 1)
        else:
            min_ops = min(min_ops, 1 + len(mst) - i)

    return str(min_ops)

