            for j in range(i + 1, n):
                if t[i] == t[j] and (j - i) % 3 != 0:
                    return False
        return True

    def min_rec(s: str, t: str) -> int:
        if is_nice(t):
            return 0
        for i in range(n):
            if s[i] == t[i]:
                continue
            t_new = t[:i] + s[i] + t[i+1:]
            if is_nice(t_new):
                return 1
            else:
                return 1 + min_rec(s, t_new)

    t_min = ""
    r_min = float('inf')
    for i in range(2 ** n):
        t = ""
        for j in range(n):
            t += s[(i >> j) & 1]
        r = min_rec(s, t)
        if r < r_min:
            r_min = r
            t_min = t

