    def min_operations(a: List[int]) -> int:
        n = len(a)
        if all(x == a[0] for x in a):
            return 0

        result = []
        for i in range(n):
            for j in range(n):
                if i == j or abs(i - j) != 1:
                    continue

                if a[i] + abs(a[i] - a[j]) > 10**18 or a[i] - abs(a[i] - a[j]) > 10**18:
                    continue

                result.append((i, j))

        if not result:
            return -1

        def dfs(cur: int, visited: List[bool], path: List[Tuple[int, int]]):
            if cur == len(result):
                return 0
            visited[cur] = True
            min_count = float('inf')
            for i in range(len(result)):
                if visited[i]:
                    continue
                a_i, a_j = result[i]
                if a_i + abs(a[a_i] - a[a_j]) > 10**18 or a_i - abs(a[a_i] - a[a_j]) > 10**18:
                    continue

                visited[i] = True
                count = dfs(cur + 1, visited, path)
                if count != -1:
                    min_count = min(min_count, count)
                visited[i] = False
            visited[cur] = False
            if min_count != float('inf'):
                path.append(result[cur])
                return min_count + 1
            return -1

        visited = [False] * len(result)
        path = []
        return dfs(0, visited, path)

    n = int(stdin.readline().strip())
