    def max_cost(n: int, a: List[int], edges: List[Tuple[int, int]]) -> int:
        max_cost = 0
        for v in range(1, n + 1):
            cost = 0
            for u in range(1, n + 1):
                dist = len(find_path(edges, u, v)) - 1
                cost += dist * a[u - 1]
            max_cost = max(max_cost, cost)
        return max_cost

    def find_path(edges: List[Tuple[int, int]], u: int, v: int) -> List[int]:
        visited = [False] * (len(edges) + 1)
        path = []
        stack = [(u, [u])]
        while stack:
            node, path = stack.pop()
            if node == v:
                return path
            if not visited[node]:
                visited[node] = True
                for neighbor in edges:
                    if neighbor[0] == node:
                        stack.append((neighbor[1], path + [neighbor[1]]))
        return []

    n, a, edges = read_input()
    return str(max_cost(n, a, edges))

