    for row in rows:
        board.append(list(row))

    def valid_move(r, c):
        return 1 <= r <= N and 1 <= c <= N

    def get_moves(r, c):
        moves = [(r + 2, c + 1), (r + 2, c - 1), (r - 2, c + 1), (r - 2, c - 1),
                 (r + 1, c + 2), (r + 1, c - 2), (r - 1, c + 2), (r - 1, c - 2)]
        return [(r, c) for r, c in moves if valid_move(r, c) and board[r - 1][c - 1] != '#']

    def knight_jumps(r, c, visited):
        if (r, c) == (1, 1):
            return 0
        if (r, c) in visited:
            return float('inf')
        visited.add((r, c))
        moves = get_moves(r, c)
        if not moves:
            return float('inf')
        return 1 + min(knight_jumps(r, c, visited) for r, c in moves)

    visited = set()
    result = knight_jumps(N, N, visited)
    if result == float('inf'):
        return '-1'
    return str(result)

